		let modalheader 	= '<div class="modal-header"><h4>'+title+'</h4><i class="modal-close icon-close"></i></div>',
			modaloverlay 	= '<div class="modal-overlay"></div>';
		console.log(overlay_visibility);
		if ( overlay_visibility == false ) {
			$('body').append(modaloverlay);
			target.find('.modal-wrapper').prepend(modalheader);
		};
		
