    function checkIfRightAge(age) {
        if (age > 5 && age < 121) {
            return true;
        } else {
            return false;
        }
    }

    function checkIfValidZipCode(zip) {
        return /^((\d{5}-\d{4})|(\d{5})|([A-Z]\d[A-Z]\s\d[A-Z]\d))$/.test(zip);
    }

    function checkIfValidEmail(email) {
        var emailformat = /^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,4})+$/;
        if ( email.match(emailformat) ) {
            return true;
        } else {
            return false;
        }
    }

